sys_variable_value.value:
(function execute(inputs, outputs) {
  var projects = [];
  if (inputs.status_code == '200') {
    var response = JSON.parse(inputs.response_body);
    for (var i = 0; i < response.projects.project.length; i++) {
      var project = response.projects.project[i];
      var listEntry = {'label': project.name + "(" + project.key + ")",
                       'name': project.key};
      projects.push(listEntry);
    }
    projects.sort(function(a, b) { return a.label < b.label ? -1 : 1 });
  }
  outputs.projects = {'data': projects}
})(inputs, outputs);

